import React from 'react';
import './sponsors.css';

function Sponsors() {

  return (
      <div className={'sponsors'}>
          <h1>Sponsors</h1>
          <p>Sponsors for 2020-2021 are still being finalized!</p>
          <h1>Past Sponsors</h1>
          <p>Facebook, Google, Boeing, Stripe, AirBnb</p>
      </div>
  );
}

export default Sponsors;
